description:
Deze ruime te renoveren villa is prachtig gelegen op een mooi groot perceel van 1.563 mÂ² aan de rand van Knokke met zicht over de polders. De ruime klassieke villa uit 1970 dient volledig te worden gerenoveerd of herbouwd te worden. Er is een mogelijkheid om de grond eventueel te verkavelen in 2 percelen voor de bouw van twee vrijstaande villa's of een koppelwoning. Dit is de ideale locatie om uw vastgoeddroom aan zee te realiseren.


Indeling: op het gelijkvloers is er een inkomhal, toilet, ruime living in L-vorm, bureel, keuken, 3 slaapkamers, twee badkamers en een inpandige garage. 

Troeven:
* Groot perceel van 1.563 mÂ²
* Grote tuin op 't zuid-westen met veel privacy en rust;
* Vrij zicht over de polders;
* Ruime te renoveren villa met 230 mÂ² bebouwde oppervlakte;
* Mogelijkheid om perceel te verkavelen in 2 bouwgronden;
* Perfecte ligging tov uitvalswegen en slechts op 5 minuten van Knokke en de zee;
